Some of the APIs and methods above create uninitialized memory in a pretty straightforward way — don't call MaybeUninit::assume_init() if things are not actually initialized! When writing tricky data structures you may end up mistakenly assuming uninitialized memory is initialized. For example imagine building a probing hashmap, backed with allocated memory: only inhabited buckets will be initialized, and if your logic for determining which buckets are inhabited is broken, your code may risk producing uninitialized values. A subtle case is when you write to uninitialized memory the wrong way. The following code uses a write to a *mut String that is pointing to uninitialized memory, and exhibits undefined behavior: # use std::mem::MaybeUninit;
let mut val: MaybeUninit<String> = MaybeUninit::uninit();
let ptr: *mut String = val.as_mut_ptr();
unsafe { // UB! *ptr = String::from("hello world");
} This is UB because writing to raw pointers, under the hood, still calls destructors on the old value, the same way a write to an &mut T does. This is usually quite convenient, but here the old value is uninitialized, and calling a destructor on it is undefined. APIs like ptr::write() and MaybeUninit::write() exist to sidestep this problem. Logically, a write to a raw pointer is functionally the same as a ptr::read() of the pointer (with the read-value being dropped) followed by a ptr::write() with the new value.

